    mainpage
        ? (
            <div>
                <button
                    type="button"
                    className="navbar-btn"
                    data-toggle="modal"
                    data-target="#register"
                >
                    {texts[language].registerButton}
                </button>
                <div
                    className="modal fade"
                    id="register"
                    tabIndex="-1"
                    role="dialog"
                    aria-labelledby="exampleModalCenterTitle"
                    aria-hidden="true"
                >
                    <div
                        className="modal-dialog modal-dialog-centered"
                        role="document"
                    >
                        <div className="modal-content">
                            <div className="modal-header">
                                <h5 className="modal-title" id="register">Welcome, keep playing!</h5>
                                <button
                                    type="button"
                                    className="close"
                                    data-dismiss="modal"
                                    aria-label="Close"
                                >
                                    <span aria-hidden="true">&times;</span>
                                </button>
                            </div>
                            <div className="modal-body" />
                            <div className="form-wrap">
                                <MyProvider>
                                    <div className="tabs">
                                        <Panel id="login">
                                            <h2 className="login-tab">Login</h2>
                                        </Panel>
                                        <Panel id="signup">
                                            <h2 className="signup-tab">Sign Up</h2>
                                        </Panel>
                                    </div>

                                    <FormPanel isActive="login">
                                        <Login />
                                    </FormPanel>

                                    <FormPanel isActive="signup">
                                        <SignUp />
                                    </FormPanel>
                                </MyProvider>
                            </div>
                            );
                        </div>
                    </div>
                </div>
            </div>
